description:
Anubis ontwikkelt een nieuwe krachtige krijger. Een zoektocht naar technologie van de Ouden (Ancients) culmineert in de schijnbare vondst van Atlantis



1.Fallen - deel 2 - 13 juni 2003 - Nadat Anubis de planeet Abydos heeft vernietigd is Daniel teruggevallen op zijn menselijke vorm. Hij komt terug bij het SGC en gaat op zoek naar De Verloren Stad. Ondertussen bedenkt SG-1 een val om het superwapen van Anubis te vernietigen.

2.Homecoming - deel 3 - 13 juni 2003 - Nadat Anubis een hersensonde in Jonas Quinn heeft geplaatst, gaat naar Jonas zijn thuiswereld om het naquadria te bemachtigen.

3.Fragile Balance - 20 juni 2003 - Een 15-jarige jongen komt het SGC binnen en zegt dat hij Jack O\'Neill is.

4.Orpheus - 27 juni 2003 - Daniel heeft een visioen van Bra\'tac en Ry\'ac die in een Jaffa doodskamp zitten. SG-1 gaat een reddingsactie uitvoeren.



